import styled, { css } from 'styled-components';

const ArticleCard = styled.div`
    height: 200px;
    width: 200px;
    border-radius: 1rem;
    background: #053868;
`

const TextCard = styled.div`
    height: 200px;
    width: 200px;
    border-radius: 1rem;
    background: #053868;
`

const TextCardTitle = styled.div`
    padding-top: 1rem;
    padding-bottom: 1rem;
    display: flex;
    justify-content: center;
    align-items: center;
    color: #ffffff;
    font-size: 18px;
`

const TextCardContent = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 5px;
    color: black;
`

const Insights = function(){
    return(
    <div>
        <div className="box-wrapper">
            <TextCard>
                <TextCardTitle>How we decided on this result</TextCardTitle>
                <TextCardContent></TextCardContent>
            </TextCard>
            <ArticleCard></ArticleCard>
        </div>
        <div className="box-wrapper">
            <TextCard>Hello World</TextCard>
            <ArticleCard></ArticleCard>
        </div>
    </div>

    );
}

export default Insights;
